nexttile %[output:5a793c5c]
scatter(-FPz, Fz_read, 1, 'b', 'filled') %[output:5a793c5c]
hold on %[output:5a793c5c]
title("Measured vs sensed (via motors) vertical force"); %[output:5a793c5c]
ylabel("Motor measured vertical force (N)"); %[output:5a793c5c]
xlabel("Force plate measured vertical force (N)"); %[output:5a793c5c]
