nexttile %[output:5a793c5c]
scatter(-FPy, Fy_read, 1, 'b', 'filled') %[output:5a793c5c]
hold on %[output:5a793c5c]
title("Measured vs sensed (via motors) horizontal force"); %[output:5a793c5c]
ylabel("Motor measured horizontal force (N)"); %[output:5a793c5c]
xlabel("Force plate measured horizontal force (N)"); %[output:5a793c5c]
hold off %[output:5a793c5c]

