t1 = 60000;
t2 = 70000;
linwidth = 1.5;
t = linspace(0, length(FPz(t1:t2))/1000, length(FPz(t1:t2)));
plot(t, Fy_cmd(t1: t2), LineWidth=linwidth, LineStyle='-', Color='#DDAA33') %[output:802ad657]
